    constructor(props){
        super();
        this.state = {
            title: '',
            created_at: '',
            rating: '',
            link: '',
            discount: '',
            src:''
        }
    }
    componentDidMount(){
        this.setState({
            title: data.text, 
            created_at: data.created_at,
            rating: data.rating,
            link: data.link,
            discount: data.discount
         })
        axios.get("/wtso")
        .then((response) => {
            console.log(response.data);
            this.setState({src: response.data});
        })
        .catch((error) => {
            console.log(error);
        })
    }


    render() {
        let header = "SAVINGS";
        const loading = this.state.src == ''
